import React from "react";
import Collection from "./";

function BotsCollection({bots}) {
  let botsList = bots.map((item)=> {
    return <Collection
    key={item.id} 
    name={item.name}
    health ={item.health}
    damage={item.damage}
    armor={item.armor}
    bot_class={item.bot_class}
    catchphrase={item.catchphrase}
    avatar_url={item.avatar_url}
    created_at={item.created_at}
    updated_at ={item.updated_at}
    />;
  })
  return (
    <table className="table">
    <tbody>
      <tr>
        <th>
          <h3 className="date">Name</h3>
        </th>
        <th>
          <h3 className="description">Health</h3>
        </th>
        <th>
          <h3 className="category">Damage</h3>
        </th>
        <th>
          <h3 className="amount">Armor</h3>
        </th>
        <th>
          <h3 className="amount">Bot Class</h3>
        </th>
        <th>
          <h3 className="amount">Catchphrase</h3>
        </th>
        <th>
          <img src={bots.avatar_url} alt="url">

          </img>
        </th>
        <th>
          <h3 className="amount">Created At</h3>
        </th>
        <th>
          <h3 className="amount">Updated At</h3>
        </th>
      </tr>
      {botsList}
    </tbody>
  </table>

